# 45. Jump Game II

from typing import List


class Solution:
    def jump2(self, nums: List[int]) -> int:
        pos = len(nums) - 1
        if pos == 0:
            return 0

        cnt = 0
        while pos != 0:
            farest_pos = pos
            for i in range(pos - 1, -1, -1):
                if nums[i] > pos - i - 1:
                    farest_pos = min(farest_pos, i)

            cnt += 1
            pos = farest_pos

        return cnt

    def jump1(self, nums):
        position = 0
        min_jmp_cnt = [len(nums)+1] * len(nums)
        min_jmp_cnt[0] = 0

        for i in range(1, len(nums)):
            print("i =", i, "; position =", position, f"; farest_point_from_{position} = ", position + nums[position])

            # position + nums[position]: farest point can jump from `position`
            # meaning: nếu điểm xa nhất có thể nhảy từ position vẫn không tới được vị trí i thì cần nhảy position tới vị trí tiếp theo để test lại vị trí
            while position + nums[position] < i:
                position += 1
                print(f"Can not reach to {i}, jump to next cell, position = {position}")

            # nếu điểm xa nhất có thể nhảy từ position đã cover được vị trí i, lưu F[i] là ``số bước ít nhất cần nhảy tới vị trí i`` là min giữa F[i] (mặc định là len(nums) + 1) với F[position] + 1 bước
            print(f"min_jmp_cnt[{i}] = min({min_jmp_cnt[i]}, {min_jmp_cnt[position] + 1})\n")
            min_jmp_cnt[i] = min(min_jmp_cnt[i], min_jmp_cnt[position] + 1)

        print(min_jmp_cnt)
        return min_jmp_cnt[-1]


    def jump0(self, nums: List[int]) -> int:
        """ Greedy BFS. Fastest """

        left, right = 0, 0
        jumps_count = 0
        
        while right < len(nums) - 1:
            right_next = right + 1
            for i in range(left, right + 1):
                right_next = max(right_next, i + nums[i])
            left, right = right + 1, right_next
            jumps_count += 1
                
        return jumps_count









